import React, { PureComponent } from 'react'
import Layout from './layout'

class Commonts extends PureComponent {
    constructor(props) {
        super(props)

        this.state = {
            posts : Object.values(this.props) 
        }
    }

    render() {
        console.log(this.state.posts)
        return (
            <Layout>
            
                   {
                       this.state.posts
                   }
               
            </Layout> 
        )
    }
}

export default Commonts
